{
  "translationLines": [
    {
      "lineNumber": 148431,
      "originalJapaneseLine": "ファーレンの体に叩きつけた。",
      "translatedEnglishLine": "I slammed (him) against Fahren's body."
    },
    {
      "lineNumber": 148432,
      "originalJapaneseLine": "…………",
      "translatedEnglishLine": "........"
    },
    {
      "lineNumber": 148433,
      "originalJapaneseLine": "……",
      "translatedEnglishLine": "..."
    },
    {
      "lineNumber": 148434,
      "originalJapaneseLine": "「がははは、あー、スッキリー！」",
      "translatedEnglishLine": "\"Gahaha, ah, that feels great!\""
    },
    {
      "lineNumber": 148435,
      "originalJapaneseLine": "（ああ、楽しかった、結局二発もしてやったぜ）",
      "translatedEnglishLine": "(Ah, that was fun, in the end I even managed to do it twice.)"
    },
    {
      "lineNumber": 148436,
      "originalJapaneseLine": "（時間も三十分ジャストか。",
      "translatedEnglishLine": "(And the time was exactly thirty minutes."
    },
    {
      "lineNumber": 148437,
      "originalJapaneseLine": "　もうちょーっと楽しみたいが",
      "translatedEnglishLine": " I want to enjoy a little longer,"
    },
    {
      "lineNumber": 148438,
      "originalJapaneseLine": "　そろそろタイムアップだな）",
      "translatedEnglishLine": " but it's almost time up.)"
    },
    {
      "lineNumber": 148439,
      "originalJapaneseLine": "「さて、そろそろケッセルリンクを殺すか」",
      "translatedEnglishLine": "\"Well then, I guess it’s time to kill Kesselring.\""
    },
    {
      "lineNumber": 148440,
      "originalJapaneseLine": "「う、うう……やっぱり、最初から……」",
      "translatedEnglishLine": "\"U-uh… After all, from the very start…\""
    },
    {
      "lineNumber": 148441,
      "originalJapaneseLine": "「おう、殺す。",
      "translatedEnglishLine": "\"Yeah, I’m going to kill you."
    },
    {
      "lineNumber": 148442,
      "originalJapaneseLine": "　悪いが勝負の世界は非情なのだ」",
      "translatedEnglishLine": " Sorry, but the world of competition is merciless.\""
    },
    {
      "lineNumber": 148443,
      "originalJapaneseLine": "「いえ……最初から、分かっていました……」",
      "translatedEnglishLine": "\"No… I understood from the start…\""
    },
    {
      "lineNumber": 148444,
      "originalJapaneseLine": "「ただ貴方は遊んでいるだけということ、",
      "translatedEnglishLine": "\"It’s just that you were only playing around,"
    },
    {
      "lineNumber": 148445,
      "originalJapaneseLine": "　約束を破ること……」",
      "translatedEnglishLine": " and breaking the promise…\""
    },
    {
      "lineNumber": 148446,
      "originalJapaneseLine": "「なに？」",
      "translatedEnglishLine": "\"What?\""
    },
    {
      "lineNumber": 148447,
      "originalJapaneseLine": "「時間は三十分……」",
      "translatedEnglishLine": "\"The time was thirty minutes…\""
    },
    {
      "lineNumber": 148448,
      "originalJapaneseLine": "「ああ、ケッセルリンク様……",
      "translatedEnglishLine": "\"Ah, Lord Kesselring…"
    },
    {
      "lineNumber": 148449,
      "originalJapaneseLine": "　私、やりきりました……」",
      "translatedEnglishLine": " I have done my best…\""
    },
    {
      "lineNumber": 148450,
      "originalJapaneseLine": "　",
      "translatedEnglishLine": ""
    },
    {
      "lineNumber": 148451,
      "originalJapaneseLine": "　＜ズッ、ズズズ……＞",
      "translatedEnglishLine": " <Zzu, zzuzuzu…>"
    },
    {
      "lineNumber": 148452,
      "originalJapaneseLine": "不気味な音を立て、セックスを始める前に",
      "translatedEnglishLine": "Making an eerie sound, before sex could begin"
    },
    {
      "lineNumber": 148453,
      "originalJapaneseLine": "ファーレンが閉じた筒がひとりでに動き出す。",
      "translatedEnglishLine": " the coffin that Fahren had closed began moving by itself."
    },
    {
      "lineNumber": 148454,
      "originalJapaneseLine": "「げ、まさか……ッ！」",
      "translatedEnglishLine": "\"Geh, no way…!\""
    },
    {
      "lineNumber": 148455,
      "originalJapaneseLine": "「お客様。",
      "translatedEnglishLine": "\"Sir,"
    },
    {
      "lineNumber": 148456,
      "originalJapaneseLine": "　どこで聞いた話かは分かりませんが、",
      "translatedEnglishLine": " I don’t know where you heard it from,"
    },
    {
      "lineNumber": 148457,
      "originalJapaneseLine": "　情報に間違いがあるようです」",
      "translatedEnglishLine": " but your information seems to be incorrect.\""
    },
    {
      "lineNumber": 148458,
      "originalJapaneseLine": "「ケッセルリンク様は日中は棺の中で",
      "translatedEnglishLine": "\"Lord Kesselring rests inside the coffin during the day,"
    },
    {
      "lineNumber": 148459,
      "originalJapaneseLine": "　お休みを取られますが、",
      "translatedEnglishLine": " but"
    },
    {
      "lineNumber": 148460,
      "originalJapaneseLine": "　別に日没で起きるわけではございません」",
      "translatedEnglishLine": " he does not necessarily wake up at sunset.\""
    },
    {
      "lineNumber": 148461,
      "originalJapaneseLine": "「日没の三十分前にはいつも規則正しく",
      "translatedEnglishLine": "\"He always wakes up precisely 30 minutes before sunset."
    },
    {
      "lineNumber": 148462,
      "originalJapaneseLine": "　起きられます」",
      "translatedEnglishLine": "\""
    },
    {
      "lineNumber": 148463,
      "originalJapaneseLine": "「な、それじゃあ……！」",
      "translatedEnglishLine": "\"T-then that means…!\""
    },
    {
      "lineNumber": 148464,
      "originalJapaneseLine": "「はい、ケッセルリンク様がお目覚めになります」",
      "translatedEnglishLine": "\"Yes, Lord Kesselring is waking up now.\""
    },
    {
      "lineNumber": 148465,
      "originalJapaneseLine": "　",
      "translatedEnglishLine": ""
    },
    {
      "lineNumber": 148466,
      "originalJapaneseLine": "　＜ズズズッ……！＞",
      "translatedEnglishLine": " <Zzuzuzu…!>"
    },
    {
      "lineNumber": 148467,
      "originalJapaneseLine": "ついに棺が開く。",
      "translatedEnglishLine": "Finally, the coffin opens."
    },
    {
      "lineNumber": 148468,
      "originalJapaneseLine": "「やばいぞ、心の友！」",
      "translatedEnglishLine": "\"This is bad, my dear friend!\""
    },
    {
      "lineNumber": 148469,
      "originalJapaneseLine": "殺せ、とカオスは言わなかった。",
      "translatedEnglishLine": "Chaos did not say 'kill'."
    },
    {
      "lineNumber": 148470,
      "originalJapaneseLine": "「逃げろ！」",
      "translatedEnglishLine": "\"Run away!\""
    },
    {
      "lineNumber": 148471,
      "originalJapaneseLine": "扉を蹴破りランスは廊下に戻った。",
      "translatedEnglishLine": "Kicking down the door, Rance returned to the corridor."
    },
    {
      "lineNumber": 148472,
      "originalJapaneseLine": "「ランス様！？」",
      "translatedEnglishLine": "\"Lord Rance!?\""
    },
    {
      "lineNumber": 148473,
      "originalJapaneseLine": "「何があった！？」",
      "translatedEnglishLine": "\"What happened!?\""
    },
    {
      "lineNumber": 148474,
      "originalJapaneseLine": "「いかん、騙されたようだ。",
      "translatedEnglishLine": "\"No good, it seems we were deceived."
    },
    {
      "lineNumber": 148475,
      "originalJapaneseLine": "　ケッセルリンクが目覚めそうだ」",
      "translatedEnglishLine": " Kesselring is about to awaken.\""
    },
    {
      "lineNumber": 148476,
      "originalJapaneseLine": "「なんだと！？」",
      "translatedEnglishLine": "\"What!?\""
    },
    {
      "lineNumber": 148477,
      "originalJapaneseLine": "その時――",
      "translatedEnglishLine": "At that moment—"
    },
    {
      "lineNumber": 148478,
      "originalJapaneseLine": "廊下が突然明かりで照らされた。",
      "translatedEnglishLine": "The corridor was suddenly illuminated by light."
    },
    {
      "lineNumber": 148479,
      "originalJapaneseLine": "「なんだァ！？",
      "translatedEnglishLine": "\"What is that!?\""
    },
    {
      "lineNumber": 148480,
      "originalJapaneseLine": "「この気配……！」",
      "translatedEnglishLine": "\"This presence…!\""
    }
  ]
}

